import { Link } from 'react-router-dom';


const HomePageView = () => {
  return (
    <div className='container'>
      <div className='header'>
        Assignment 3
      </div>
      <div className='links'>
        <Link to={'/employees'} > All Employees </Link>
        <Link to={'/tasks'} > All Tasks </Link>
      </div>
    </div>
  );    
}




export default HomePageView;
